import React, { useEffect } from "react";
import Hero from "../components/Hero";
import { useDispatch } from "react-redux";
import { fetchCart } from "../redux/actions/cartActions";

const Home = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchCart())
  });
  return (
    <div>
      <Hero />
    </div>
  );
};

export default Home;
